function Input() {
  return (
    <div className="form-group">
        <label className="control-label" htmlFor="inputGroup">Дата и время заказа</label>
        <div className="input-group">
          <input type="text" className="form-control-incorrect" placeholder="06.12.2021" />
          <span className="input-group__icon-incorrect">
            <svg viewBox="0 0 16 16" fill="none" stroke="#BAD8F5" xmlns="http://www.w3.org/2000/svg">
              <path d="M12.5 3.5L3.5 12.5M3.5 3.5L12.5 12.5" fill="none" />
            </svg>
          </span>
        </div>
    </div>
  );
}

export default Input;
